import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Nav from './component/Nav';
function App() {

  return (
    <BrowserRouter>
    <div className="App">
      <Nav />
        <Routes>
          <Route path="/"/>
          <Route path="/cart"/>
        </Routes>
    </div>
   </BrowserRouter>
  );
}

export default App;
